import React from 'react';

const PlusSign = () => (
	<svg width="18px" height="18px" viewBox="0 0 13 13">
		<g id="01-Homepage" stroke="none" strokeWidth="1" fill="none" fillRule="evenodd">
			<g id="Reliant-Homepage-v5" transform="translate(-678.000000, -4673.000000)" fill="#2F2F2F">
				<g id="Group-2" transform="translate(684.500000, 4679.500000) rotate(-45.000000) translate(-684.500000, -4679.500000) translate(679.000000, 4674.000000)">
					<g id="Group-4" transform="translate(0.165476, 0.428932)">
						<rect id="Rectangle" transform="translate(5.000000, 5.000000) rotate(45.000000) translate(-5.000000, -5.000000) " x="-1" y="4" width="12" height="2"></rect>
						<rect id="Rectangle" transform="translate(5.000000, 5.000000) scale(-1, 1) rotate(45.000000) translate(-5.000000, -5.000000) " x="-1" y="4" width="12" height="2"></rect>
					</g>
				</g>
			</g>
		</g>
	</svg>
);

export default PlusSign;
